import React from "react";
import {
  FaHome,
  FaStar,
  FaDoorOpen,
  FaCalendarAlt,
  FaShareAlt,
  FaHeart,
} from "react-icons/fa";
import "../components/ListingDetailsPage.css";

const ListingDetailsPage = () => {
  return (
    <div className="listing-details">
      {" "}
      <header className="listing-header">
        {" "}
        <div className="header-left">
          {" "}
          <h1>Bordeaux Getaway</h1>{" "}
          <div className="rating-info">
            {" "}
            <span>★ 5.0</span> <span> · 7 reviews</span>{" "}
            <span> · Superhost ·</span> <span> Bedroom, France</span>{" "}
          </div>{" "}
        </div>{" "}
        <div className="header-right">
          {" "}
          <FaShareAlt />
          <span>Share</span> <FaHeart />
          <span>Save</span>{" "}
        </div>{" "}
      </header>{" "}
      <div className="listing-images">
        {" "}
        <img src="image1.jpg" alt="Living room" className="main-image" />{" "}
        <div className="sub-images">
          {" "}
          <img src="https://a0.muscache.com/im/pictures/3799df5e-18fe-4867-b297-c309f6e48bad.jpg?im_w=720" alt="Dining area" />{" "}
          <img src="https://a0.muscache.com/im/pictures/f32971f1-0242-477b-be83-21393c0378f6.jpg?im_w=720" alt="Kitchen" />{" "}
          <img src="https://a0.muscache.com/im/pictures/7236eed4-80b9-4cf3-8daf-7a7309d813aa.jpg?im_w=720" alt="Bedroom" />{" "}
          <img src="https://a0.muscache.com/im/pictures/3fd0aea9-833b-4202-b7ef-abb1772e6ad4.jpg?im_w=720" alt="Bathroom" />{" "}
        </div>{" "}
      </div>{" "}
      <section className="listing-info">
        {" "}
        <div className="info-left">
          {" "}
          <h2>Entire rental unit hosted by Ghazal</h2>{" "}
          <p>2 guests · 1 bedroom · 1 bed · 1 bath</p>{" "}
        </div>{" "}
        <div className="info-right">
          {" "}
          <img
            src="profile.jpg"
            alt="Host profile"
            className="host-profile-image"
          />{" "}
        </div>{" "}
      </section>{" "}
      <section className="listing-features">
        {" "}
        <div className="feature-item">
          {" "}
          <FaHome className="feature-icon" />{" "}
          <div>
            {" "}
            <h4>Entire home</h4> <p>You’ll have the apartment to yourself.</p>{" "}
          </div>{" "}
        </div>{" "}
        <div className="feature-item">
          {" "}
          <FaStar className="feature-icon" />{" "}
          <div>
            {" "}
            <h4>Enhanced Clean</h4>{" "}
            <p>
              This Host committed to Airbnb’s 5-step enhanced cleaning process.
              Show more
            </p>{" "}
          </div>{" "}
        </div>{" "}
        <div className="feature-item">
          {" "}
          <FaDoorOpen className="feature-icon" />{" "}
          <div>
            {" "}
            <h4>Self check-in</h4> <p>Check yourself in with the keypad.</p>{" "}
          </div>{" "}
        </div>{" "}
        <div className="feature-item">
          {" "}
          <FaCalendarAlt className="feature-icon" />{" "}
          <div>
            {" "}
            <h4>Free cancellation</h4> <p>Free cancellation before Feb 14.</p>{" "}
          </div>{" "}
        </div>{" "}
      </section>{" "}
      <section className="listing-description">
        {" "}
        <p>
          {" "}
          Come and stay in this superb duplex T2, in the heart of the historic
          center of Bordeaux. Shops and restaurants are within walking distance.
          You will enjoy all the charms of the city, thanks to its location
          close to many shops, bars, and restaurants. You can access the
          apartment by tram A and C and bus routes 27 and 4.{" "}
        </p>{" "}
      </section>{" "}
      <section className="reservation-card">
        {" "}
        <div className="reservation-header">
          {" "}
          <span>$75 / night</span> <span>★ 5.0 · 7 reviews</span>{" "}
        </div>{" "}
        <table className="reservation-table">
          {" "}
          <tbody>
            {" "}
            <tr>
              {" "}
              <td>Check-in</td> <td>Check-out</td>{" "}
            </tr>{" "}
            <tr>
              {" "}
              <td>
                <input type="date" />
              </td>{" "}
              <td>
                <input type="date" />
              </td>{" "}
            </tr>{" "}
            <tr>
              {" "}
              <td>Guests</td>{" "}
              <td>
                {" "}
                <select>
                  {" "}
                  <option>1 guest</option> <option>2 guests</option>{" "}
                  <option>3 guests</option> <option>4 guests</option>{" "}
                </select>{" "}
              </td>{" "}
            </tr>{" "}
          </tbody>{" "}
        </table>{" "}
        <button className="reserve-button">Reserve</button>{" "}
        <p className="no-charge">You won’t be charged yet</p>{" "}
        <table className="cost-table">
          {" "}
          <tbody>
            {" "}
            <tr>
              {" "}
              <td>$75 x 7 nights</td> <td>$525</td>{" "}
            </tr>{" "}
            <tr>
              {" "}
              <td>Cleaning fee</td> <td>$60</td>{" "}
            </tr>{" "}
            <tr>
              {" "}
              <td>Service fee</td> <td>$83</td>{" "}
            </tr>{" "}
            <tr>
              {" "}
              <td>Occupancy taxes and fees</td> <td>$29</td>{" "}
            </tr>{" "}
            <tr className="total">
              {" "}
              <td>Total</td> <td>$697</td>{" "}
            </tr>{" "}
          </tbody>{" "}
        </table>{" "}
        <p className="report-listing">Report this listing</p>{" "}
      </section>
      <section className="listing-amenities">
        <h3>What this place offers</h3>
        <ul>
          <li>Garden view</li>
          <li>WiFi</li>
          <li>Free washer - in building</li>
          <li>Central air conditioning</li>
          <li>Refrigerator</li>
          <li>Kitchen</li>
          <li>Pets allowed</li>
          <li>Dryer</li>
          <li>Security cameras on property</li>
          <li>Bicycles</li>
        </ul>
      </section>
      <section className="listing-calendar">
        <h3>7 nights in Bordeaux</h3>
        <p>Feb 16, 2022 - Feb 23, 2022</p>
        <div className="calendar">{/* Calendar component goes here */}</div>
      </section>
      <section className="listing-reviews">
        <h3>5.0 · 7 reviews</h3>
        <ul>
          <li>
            <p>
              <strong>Shayma</strong> - December 2021
            </p>
            <p>
              Wonderful neighborhood, easy access to restaurants and the subway,
              cozy stylish apartment with a very comfortable bed. Great host,
              super helpful and responsive. Couldn’t be better.
            </p>
          </li>
          <li>
            <p>
              <strong>Vachon</strong> - November 2020
            </p>
            <p>
              This is an amazing place. It has everything one needs for a
              monthly business stay. Very clean and organized place. Amazing
              hospitality affordable price.
            </p>
          </li>
          <li>
            <p>
              <strong>Jennifer</strong> - January 2022
            </p>
            <p>
              A perfect place, near a tube station and a supermarket with
              everything you need.
            </p>
          </li>
        </ul>
      </section>
      <section className="listing-host">
        <h3>Hosted by Ghazal</h3>
        <p>Joined in May 2021 · 12 reviews · Identity verified · Superhost</p>
        <p>
          Ghazal is a Superhost. Superhosts are experienced, highly rated hosts
          who are committed to providing great stays for guests.
        </p>
        <button>Contact Host</button>
      </section>
      <section className="listing-details">
        <h3>Things to know</h3>
        <div className="details">
          <div className="house-rules">
            <h4>House rules</h4>
            <ul>
              <li>Check-in after 3:00 PM</li>
              <li>Check-out before 11:00 AM</li>
              <li>No smoking</li>
              <li>No parties or events</li>
            </ul>
          </div>
          <div className="health-safety">
            <h4>Health & safety</h4>
            <ul>
              <li>Enhanced cleaning process</li>
              <li>COVID-19 safety measures</li>
              <li>Smoke detector</li>
              <li>Carbon monoxide detector</li>
            </ul>
          </div>
          <div className="cancellation-policy">
            <h4>Cancellation policy</h4>
            <ul>
              <li>Free cancellation before Feb 14</li>
              <li>Partial refund afterward</li>
            </ul>
          </div>
        </div>
      </section>
    </div>
  );
};

export default ListingDetailsPage;
